import "../styles/searchPage.scss";
import { useEffect } from "react";
import { useNavigate } from "react-router-dom";
function SearchPage() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
  const navigate = useNavigate();
  return <div className="search-container">Hi?</div>;
}
export default SearchPage;
